import React from 'react';

class MyComponent extends React.Component {

    state = {
        name:"tri",
        age:20
    }
    handleClick () {
        if (this.state.name=="tri") {
            this.setState ({
                name:"quan"
            })
        }
        else {
            this.setState ({
                name:"tri"
            })
        }
    }
    render() {
        return (
            <div>
                xin chào tôi tên là {this.state.name}
                <button onClick={() => {this.handleClick()}}>Nút bấm</button>
                <br/>
                <form>
                    <input type="text"/>
                </form>
                <br/>
            </div>
            
        );
    }
}
export default MyComponent;
